import './Content.css';
import { Helmet } from 'react-helmet';

export default function Content() {
    return (
        <div className="content">
            <h1>Cost of Living Calculator</h1>
            <p>     Welcome to Salary Comp, the web app that helps you compare the real value of job offers by factoring in the cost of living.

Our app is simple to use. Just input the city and salary for each job offer you're considering, and we'll calculate the real value of each offer based on the cost of living in each location. You'll get a clear picture of how much you'll actually be able to afford in each city, and which job offer will give you more purchasing power and a better quality of life. 
</p>
        </div>
    )
}
